    <div className="container">
      <div className="ui breadcrumb">
        <Link href="/">
          <a className="section">Trang chá»§</a>
        </Link>
        <i aria-hidden="true" className="right angle icon divider"></i>
        <a className="section">{data.title}</a>
      </div>
